import React, { useEffect, useState } from 'react';
import './FrontPage.css';
import { Link } from 'react-router-dom';
import EmployeeService from './services/EmployeeService';

const columns = [
    { key: 'firstName', label: 'FIRSTNAME' },
    { key: 'lastName', label: 'LASTNAME' },
    { key: 'email', label: 'EMAIL' },
    { key: 'mobileNumber', label: 'MOBILENUMBER' },
    { key: 'dob', label: 'DOB' },
    {key :'address' ,label:'ADDRESS'},
    { key:'actions',label:'ACTIONS'},
];


function FrontPage() {
    const[employee,setEmployee]=useState([])
    useEffect(()=>{
        getTemp();
    },{})
    const getTemp=()=>{

        EmployeeService.getEmployee().then((response)=>{
            console.log(response.data);
          setEmployee(response.data);
        }).catch(error=>{

            console.log(error);
        });
    }
  const deleteEmployee= (employeeId) =>

  {
    EmployeeService.deleteEmployee(employeeId).then((response) =>{
        console.log(response.data)
        }).catch(error => {
        console.log(error)
    })}

    return (
        <div className="App">
            <div className="logo">
                <img id="logo1" src="https://divum.in/images/logo/Divum_Logo%20SVG%20(2).svg" alt="Logo" />
            <div className="btnn">
                <button type="submit" id="button"><Link to="/login">Add</Link></button>

            </div>
            </div>
            <table>
                <thead>
                    <tr>
                        {columns.map((column) => (
                            <th key={column.key}>{column.label}</th>
                        ))}
                    </tr>
                </thead>
                <tbody>
                    {employee.map((employee) => (
                        <tr key={employee.id}>
                            <td>{employee.firstName}</td>
                            <td>{employee.lastName}</td>
                            <td>{employee.email}</td>
                            <td>{employee.mobileNumber}</td>
                            <td>{employee.dob}</td>
                            <td>{employee.address}</td>
                            <td>{employee.actions}<button type="onClick" onClick={()=>deleteEmployee(employeeId)} id="actions">DELETE</button><br></br><button type="onClick" id="actions">UPDATE</button></td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>

    );
}
export default FrontPage;
